import React from 'react';
import { View, Text, StyleSheet } from 'react-native';
import { createStackNavigator } from '@react-navigation/stack';
import { Entypo } from '@expo/vector-icons';

const Stack = createStackNavigator();

const HomeScreen = () => {
  return (
    <Stack.Navigator>
      <Stack.Screen
        options={{
          headerStyle: { backgroundColor: 'transparent', elevation: 0, shadowOpacity: 0 },
          headerLeft: () => (
              <ScreenHeaderBtn iconUrl={<Entypo name="menu" size={24} color="black" />} dimension="60%" />
          ),
          headerRight: () => (
              <ScreenHeaderBtn iconUrl={<Entypo name="menu" size={24} color="black" />} dimension="100%" />
          ),
          headerTitle: "ENTE NADU"
        }}
      
      />
    </Stack.Navigator>
  );
};

const HomeScreenContent = () => {
  return (
    <View style={styles.container}>
      <Text style={styles.message}>Home Screen</Text>
    </View>
  );
};

const styles = StyleSheet.create({
  container: {
    flex: 1,
    justifyContent: 'center',
    alignItems: 'center',
    padding: 20,
  },
  message: {
    fontSize: 24,
    fontWeight: 'bold',
  },
});

export default HomeScreen;
